import { string } from "prop-types";
import React, {Component} from "react";
import { Container, InfoDiv, InfoTitle, InfoBox} from "./step-info.styles";


class StepInfo extends Component{
    constructor(props){
        super(props)
    }

    render(){
        let {taskOwner,taskEndDate, taskStartDate} = this.props
        return(
            <Container>
                <InfoDiv>
                    <InfoTitle>
                        Task Owner
                    </InfoTitle>
                    <InfoBox>
                        Myles
                    </InfoBox>
                </InfoDiv>

                <InfoDiv>
                    <InfoTitle>
                        Start Date
                    </InfoTitle>
                    <InfoBox>
                        {str.index(taskStartDate, 0, 10)}
                    </InfoBox>
                </InfoDiv>

                <InfoDiv>
                    <InfoTitle>
                        End Date
                    </InfoTitle>
                    <InfoBox>
                        {taskEndDate}
                    </InfoBox>
                </InfoDiv>
            </Container>
        )
    }
}

export default StepInfo;
